import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import { Route, Router } from "react-router-dom";
import FinalReport from "./components/pages/FinalReport";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <Router>
      <Route path="/" element={<App />} />
      <Route path="reporte" element={<FinalReport />} />
    </Router>
    <App />
  </React.StrictMode>
);
